Per quanto riguarda i permessi non usufruiti dei ragazzi gli importi che dovresti corrispondere a loro sono i seguenti:
- Susanna : ha diritto a 3.5 ore al mese per euro 10.43. Totale 77 ore*10.43=803.11;
- Rita : ha diritto a 3.5 ore al mese per euro 10.43. Totale 77 ore*10.43=803.11;
- Giampaolo : ha diritto a 3.5 ore al mese per euro 10.43. Totale 77 ore*10.43=803.11;
- Umberto : ha diritto a 4.08 ore al mese per euro 9.60. Totale 89.83 ore*9.60=862.37.

A partire dal mese di dicembre i permessi ROL dei ragazzi vanno pagati solo a metà perché siccome sonno passati 2 anni di contratto iniziano a maturare l'altra metà in busta paga. Quindi:

- Rita :1.75 ore x euro 10.43 = 18.25 euro;
- Giampaolo : 1.75 ore x euro 10.43 = 18.25 euro;
- Umberto : 2.04 x euro 9.60 = 19.59 euro.

FA.RI.AN - iscrizione inps, inail, assunzione + contratto 2 dipendenti;
SOLARIS - assunzione + contratto 1 dipendente;
